import React from 'react'
import Bar from './Bar';
import Img from './Img'

const Home = props => {

    return (
        <div>
            <Bar />
            <Img />
            <br />
            <div class="embed-responsive embed-responsive-21by9">
                <iframe class="embed-responsive-item" src="https://www.youtube.com/watch?v=mFKoeai0y8s"></iframe>
            </div>
        </div>
    )
}

export default Home;
